import React from 'react'
import { Switch, Route, Link } from "react-router-dom";

import { ReactComponent as Code } from '../../assets/svg/code.svg';
import { ReactComponent as ArrowRight } from '../../assets/svg/arrow-right.svg';


const Content = () => <div>You're on the Contact Tab</div>;

function Portfolio() {

    const { path } = this.props.match;

	return (
		<div className="side right">
			<Code className="code-icon" />
			<h1 className="title">Work</h1>
			<ArrowRight className="right-arrow-icon" />

            <Switch>
                <Route path={`${path}/portfolio`} component={Content} />
            </Switch>
		</div>


	)
}

export default Portfolio
